import React from 'react'
import './Beardcrum.css'
import arrow_icon from '../Assets/breadcrum_arrow.png'
function Breadcrum(props) {
    const {product} = props ;
  return (
    <div className='breadcrum'>
      HOME <img src={arrow_icon} alt=''/> SHOP <img src={arrow_icon} alt=''/> {product.ategory} <img src={arrow_icon} alt=''/> {product.name}

    </div>
  )
}

export default Breadcrum
